import React, { useState } from "react"
import axios from "axios"
import { useNavigate, Link } from "react-router-dom"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {  faEnvelope,faLock } from '@fortawesome/free-solid-svg-icons';
import './Login.css';

function Login() {

    const history=useNavigate();

    const [email,setEmail]=useState('')
    const [password,setPassword]=useState('')
    const[username, setUsername] =useState('')
    const [networkDevicesname, setNetworkDevice] = useState('');
    const [connectedDevices, setConnectedDevices] = useState('');
    const [currentBalance, setCurrentBalance] = useState('');
    const [Amount, setAmount] = useState('')
    const [paymentStatus, setPaymentStatus] = useState('')
    const [networkSpeed, setNetworkSpeed] = useState('')
    const [remainingDay, setRemainingDay] = useState('')
    const [subscriptionStartDate, setSubscriptionStartDate] = useState('');
    const [signalStrength, setSignalStrength] = useState('');

    async function submit(e) {
        e.preventDefault();
        try {
            const response = await axios.post("http://localhost:8000/login", {
                email,
                password
            });
    
            if (response.data.status === "success") {
                const userData = response.data.user;
                history("/home", { 
                    state: {  
                        id: email,
                        name: userData.username,
                        network: userData.networkDevicesname,
                        connected: userData.connectedDevices,
                        current: userData.currentBalance,
                        amount: userData.Amount,
                        payment: userData.paymentStatus,
                        speed: userData.networkSpeed,
                        remain: userData.RemainingDays,
                        subscription: userData.subscriptionStartDate,
                        signal: userData.signalStrength
                    } 
                });
            } else if (response.data.status === "fail") {
                alert("User does not exist or wrong password");
            }
        } catch (error) {
            alert("Error logging in");
            console.error(error);
        }
    }



    return (
        <div className="login">
            <div className="logo">
            <img src="https://i.postimg.cc/CLdpsq5h/Wifi-provider-removebg-preview.png" alt="Wifi-provider"></img>
            </div>

            <h1>Login </h1>
            <form action="POST">
            <div className="input-group">
                <FontAwesomeIcon icon={faEnvelope} className="icon" /><input type="email" onChange={(e) => { setEmail(e.target.value) }} placeholder="Email"  />
                </div>
                <br />
                <div className="input-group">
                <FontAwesomeIcon icon={faLock} className="icon" /><input type="password" onChange={(e) => { setPassword(e.target.value) }} placeholder="Password"  />
                </div>
                <input type="hidden" value={username} onChange={(e) => setUsername(e.target.value)} />
                <input type="hidden" value={networkDevicesname} onChange={(e) => setNetworkDevice(e.target.value)} />
                <input type="hidden" value={connectedDevices} onChange={(e) => setConnectedDevices(e.target.value)} />
                <input type="hidden" value={currentBalance} onChange={(e) => setCurrentBalance(e.target.value)} />
                <input type="hidden" value={Amount} onChange={(e) => setAmount(e.target.value)} />
                <input type="hidden" value={paymentStatus} onChange={(e) => setPaymentStatus(e.target.value)} />
                <input type="hidden" value={networkSpeed} onChange={(e) => setNetworkSpeed(e.target.value)} />
                <input type="hidden" value={remainingDay} onChange={(e) => setRemainingDay(e.target.value)} />
                <input type="hidden" value={subscriptionStartDate} onChange={(e) => setSubscriptionStartDate(e.target.value)} />
                <input type="hidden" value={signalStrength} onChange={(e) => setSignalStrength(e.target.value)} />
                <br />
                <input type="submit" onClick={submit} />

            </form>

            <br />
            <p>Create an Account !</p> <Link to="/signup">Register</Link>

        </div>
    )
}

export default Login
